// prisma/seed.ts
import { PrismaClient } from '@prisma/client';
import bcrypt from 'bcrypt';

const prisma = new PrismaClient();

async function main() {
  // Create system admin role
  const systemAdminRole = await prisma.userRole.create({
    data: {
      name: 'systemAdmin',
      permissions: {
        set: ['*'], // All permissions
      },
    },
  });

  // Hash the password
  const hashedPassword = await bcrypt.hash('yourCompanyAdmin2024!', 10);

  // Create system admin user
  // name: System Admin
  // email: admin@yourCompany.co
  // password: yourCompanyAdmin2024!
  const systemAdminUser = await prisma.user.create({
    data: {
  //     id         String        @id @default(auto()) @map("_id") @db.ObjectId
  // name       String
  // image      String?
  // email      String     @unique
  // password   String
  // hashedPassword String
  // emailCode String
  // isEmailVerify Boolean
  // inviteStatus String // 'signUp', 'readyToUpdatePassword', 'invited'
  // role       String // 'systemAdmin', 'businessOwner', 'user'
  // businessIDs String[]   @db.ObjectId
  // businesses  Business[] @relation(fields: [businessIDs], references: [id])
  // tokens     Token[]
  // userRoleIDs  String[]     @db.ObjectId
  // UserRoles    UserRole[]   @relation(fields: [userRoleIDs], references: [id])

      name: 'System Admin',
      email: 'admin@yourCompany.co',
      password: hashedPassword,
      hashedPassword,
      emailCode: 'SyetemAdmin',
      isEmailVerify: true,
      inviteStatus: 'signUp',
      image: 'data:image/png;base64,',
      role: 0,
      businesses: {
        create: {
          name: 'System Admin Business',
        },
      },
    },
  });

  console.log('Seed data created:', systemAdminUser);
}

main()
  .catch((e) => {
    console.error(e);
    process.exit(1);
  })
  .finally(async () => {
    await prisma.$disconnect();
  });
